   const onFileUpload = () => {

    const lfile = new FormData();
    lfile.append("image",avatar,avatar.name)
  
    // axios.post("api/endpoint/lfile")
   }
    

    return(
        <div>
            <h1>hello this is SignUp page</h1>
           
                <div className="email">
                    <input type="Email" placeholder="inter your email"/>
                </div>
                <div className="password">
                    <input type="password" placeholder="inter your password"/>
                </div>
                <div className="repassword">
                    <input type="password" placeholder="repeat your password"/>
                </div>
                <div className="avatar">
                    {/* <lable>avatar</lable> */}
                    <input type="file" placeholder="avatar" onChange={e=>setAvatar( e.target.files[0]) }/>
                </div>
                <div className="submit">
                    {/* <lable>avatar</lable> */}
                    <input type="submit" title="Submit"onClick={onFileUpload}/>
                </div>
                
           
            <div>
                {/* <img src={} alt={avatar.alt}/> */}
            </div>

        </div>
    )
}
export default SignUp
